import 'bootstrap/dist/css/bootstrap.min.css';
import { React} from 'react';
import './App.css'
import GridExample from './omsOrderComponent/GridExample';
import { Routes, Route } from "react-router-dom";

function App() {
    return (
      <div >

          <Routes>
              <Route></Route>
              <Route exact path="/GridExample" element={<GridExample/>} />
          </Routes>




      </div>
    );
  }
  export default App;
